    with various methods by the SSPP pipeline.
  datatype: FIT
  filesize: 500 KB
  releases:
  - DR8
  - DR9
  - DR10
  - DR12
  - DR11
  - DR13
  - DR14
  - DR15
  - DR16
  - DR17
  environments:
  - SSPP_REDUX
  naming_convention: ssppOut-[0-9]{4}-[0-9]{5}\.fit, where [0-9]{4} is a 4-digit plate
    number, and [0-9]{5} is a 5-digit MJD.
  generated_by: sspp
